import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import "./ILBPair.sol";

interface ILBFactory {
    struct LBPairInformation {
        uint16 binStep;
        ILBPair LBPair;
        bool createdByOwner;
        bool ignoredForRouting;
    }

    function getLBPairInformation(
        IERC20 tokenA,
        IERC20 tokenB,
        uint256 binStep
    )
        external
        view
        returns (LBPairInformation memory lbPairInformation);
}
